import React from "react";
import '../css/Tas'

function Tarea({texto}) {
  return (
    <div className="TaskItem">
        <div className="TaskText">
            {texto}
        </div>
        <div className="TaskIcon">
            Eliminar
        </div>
    </div>
  ); 
}

export default Tarea;
